text:
Il #Senato ha votato: il #ddlZan sarà in aula il 13 luglio.

Alla fine solo molto rumore che, però, non ha potuto coprire la forza di una legge di giustizia e la perseveranza di chi ha sempre voluto portarla avanti. 

@SenatoriPD 
@pdnetwork

Buongiorno amici! 
Ieri con Giorgia giornata bellissima che si è conclusa con la presentazione a #Milano del suo libro #IoSonoGiorgia intervistata dal grande Direttore Vittorio Feltri! 
@GiorgiaMeloni https://t.co/vAYN8dtu96

Dopo la conclusione della votazione in Aula sulla calendarizzazione del #ddlZAN, vi aspetto in 🎥diretta, alle 19.00, sulla mia Pagina Facebook per darvi gli ultimi aggiornamenti. 
Seguitemi!📣🏳️‍🌈🏳️‍⚧️
